import {React,useState,useEffect} from 'react';
import './home.css';

export default function Home(){
    const [logged_in_user,setLoggedInUser] = useState({
        employee_id: '',
        employee_name: ''
    })
    const [loading,setLoading] = useState(false)

    useEffect(() => {
        setLoading(true)
        setLoggedInUser(JSON.parse(localStorage.getItem("logged_in_user")))
        setTimeout(() => {
            setLoading(false)
        }, 1000);
    },[])
    return(
        <div className="h-100">
            {
                loading === true ?
                <div>
                    Loading ....
                </div> :
                <div className="d-flex main-container">
                    <div className="header navbar-fuse-sidebar left-positioned open locked-open unfoldedSidebar p-3">
                        <div className="text-justify">
                            <div>{logged_in_user.employee_id}</div>
                            <div>{logged_in_user.employee_name}</div>
                        </div>
                        <div className="logout">
                            <i className="fa fa-sign-out text-white fs-16"></i>
                            Logout
                        </div>
                    </div>
                    <div className="w-100 pt-10 pl-3 pr-3">
                        <h3 className="font-weight-bold text-center">CHALLENGES</h3>
                        <button type="button" className="btn btn-success text-white d-block pull-right fs-13">Create Challenges</button>
                    </div>
                </div> 

            }
        </div>
    )
}
